import React from 'react';
import theme from './Theme';

function Footer() {

  return (
    <footer style={{backgroundColor:theme.colors.primary, color:'white'}}>
      <div>
        <p>&copy; {new Date().getFullYear()} Undefined</p>
      </div>
    </footer>
  );
}

export default Footer;
